/* eslint-disable react/react-in-jsx-scope */
import { Badge } from "react-bootstrap";
import { Testimonials } from "../dataProduct/dataProduct";


const TestimonialBadge = () => {
  const BadgeTesti = Testimonials.reduce((acc, curr) => {
    return acc + curr.Valuebadge;
  });

  return (
    <div>
      <Badge bg="secondary">{BadgeTesti}</Badge>
    </div>
  );
};
export default TestimonialBadge;
